<link href="https://fonts.googleapis.com/css2?family=Baumans&display=swap" rel="stylesheet">
<link rel="icon" type="image/png" sizes="256x256" href="./SCP FOUNDATION/assets/favicons/favicon.png">
<style>
  body {
    overflow: hidden;
    font-family: Baumans;
    font-weight: 400;
    background-color: gray;
    color: white;
    background-size: cover;
    background-position: center;
    background-attachment: fixed;
    user-select: none;
  }

  @keyframes fadeInAnimation {
    0% {
      opacity: 0;
    }

    100% {
      opacity: 1;
    }
  }

  .context-menu {
    position: absolute;
    backdrop-filter: blur(90%);
    animation: fadeInAnimation ease 0.4s;
    text-align: center;
    width: 20%;
    height: 26vh;
    background: #2c2c2c;
    border-radius: 10px;
    background: rgba(255, 255, 255, 0.08);
  }

  .context-menu ul {
    padding: 0px;
    margin: 0px;
    min-width: 150px;
    list-style: none;
  }

  .context-menu ul li {
    padding-bottom: 6px;
    text-align: left;
    padding-top: 6px;
  }

  .context-menu ul li a {
    font-family: 'Verdana';
    margin: 40px;
    with: 50%;
    text-decoration: none;
    right: 90%;
    font-size: 13px;
    color: white;
  }

  .context-menu ul li:hover {
    background: rgba(255, 255, 255, 0.2);
  }

  input {
    background: rgba(255, 255, 255, 0.08);
    border: none;
    color: white;
    font-size: 16px;
    font-family: Baumans;
    border-radius: 10px;
    padding: 10px;
    width: 18%
  }
</style>
<script>
  //This Disables right click
  document.addEventListener('contextmenu', event => event.preventDefault())
  //This disables f12
  document.onkeypress = function (event) {
    event = (event || window.event);
    if (event.keyCode == 123) {
      return false;
    }
  }

  document.onmousedown = function (event) {
    event = (event || window.event);
    if (event.keyCode == 123) {
      return false;
    }
  }
  document.onkeydown = function (event) {
    event = (event || window.event);
    if (event.keyCode == 123) {
      return false;
    }
  }
</script>
